def earlyPrecision(precision, TPR, findatx):
    # this function takes sorted lists of full PR stats and filters to 0.1 lists
    earlyTPR = [x for x in TPR if x <= 0.1]
    endpoint = len(earlyTPR)
    if len(earlyTPR) != len(TPR):
        earlyprec = precision[endpoint-1] + (findatx - TPR[endpoint-1])*((precision[endpoint] - precision[endpoint-1])/(TPR[endpoint]-TPR[endpoint-1]))
        #earlyprec = precision[endpoint]
    else:
        earlyprec = precision[-1]
    return earlyprec

